#include <stdio.h>
#include <string.h>
#include <stdlib.h>

#define MOD 1000000007

int digitSum(int n) {
    int sum = 0;
    while (n > 0) {
        sum += n % 10;
        n /= 10;
    }
    return sum;
}

int countGoodIntegersInRange(char *lower, char *upper, int minSum, int maxSum) {
    long long lowerNum = atoll(lower);
    long long upperNum = atoll(upper);
    int count = 0;
    for (long long i = lowerNum; i <= upperNum; ++i) {
        int sum = digitSum(i);
        if (sum >= minSum && sum <= maxSum) {
            count = (count + 1) % MOD;
        }
    }
    return count;
}

int count(char * num1, char * num2, int min_sum, int max_sum){
    return countGoodIntegersInRange(num1, num2, min_sum, max_sum);
}
